import Foundation

/**
 Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).
 
 Example:
 ````
 Input: S = "ADOBECODEBANC", T = "ABC"
 Output: "BANC"
 ````
 Note:
 
 If there is no such window in S that covers all characters in T, return the empty string "".
 If there is such window, you are guaranteed that there will always be only one unique minimum window in S.
 */
class Solution76: SolutionDelegate {
    
    let bc = { (c: Character) -> Int in
        return Int(c.unicodeScalars.first!.value) - 65
    }
    
    func soluction(_ s: String, _ t: String) -> String {
        var search = s.startIndex
        var head = s.startIndex
        var setT = Set<Character>()
        
        var shortHead = s.endIndex
        var shortEnd = s.endIndex
        
        var arrT = Array<Int>(repeating: 0, count: 59)
        var arrS = Array<Int>(repeating: 0, count: 59)
        var flag = false
        for c in t {
            arrT[bc(c)] += 1
            setT.insert(c)
        }

        while search < s.endIndex {
            
            arrS[bc(s[search])] += 1

            while head < search {
                let i = bc(s[head])
                
                let value = arrT[i]
                if value == 0 {
                    head = s.index(head, offsetBy: 1)
                } else if arrS[i] > value {
                    arrS[i] -= 1
                    head = s.index(head, offsetBy: 1)
                } else {
                    break
                }
            }
            
            if windowOk(arrS, arrT, setT) {
                let length =  search.encodedOffset - head.encodedOffset + 1
                if (s.endIndex == shortHead || (shortEnd.encodedOffset - shortHead.encodedOffset + 1) > length) {
                    shortHead = head
                    shortEnd = search
                    flag = true
                }
            }
            
            search = s.index(search, offsetBy: 1)
        }
        
        return flag ? String(s[shortHead...shortEnd]) : ""
    }
    
    func windowOk(_ arrS: Array<Int>, _ arrT: Array<Int>, _ setT: Set<Character>) -> Bool {
        for s in setT {
            let i = bc(s)
            if arrS[i] < arrT[i] {
                return false
            }
        }
        return true
    }
    
